import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Table, Button, ButtonToolbar } from 'react-bootstrap';
import TopNav from './nav.component';


const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
    },
    appBar: {
        zIndex: theme.zIndex.drawer + 1,
    },
    drawer: {
        width: drawerWidth,
        flexShrink: 0,
    },
    drawerPaper: {
        width: drawerWidth,
    },
    drawerContainer: {
        overflow: 'auto',
    },
    content: {
        flexGrow: 1,
        padding: theme.spacing(3),
    },
}));

export default function ClippedDrawer() {
    const classes = useStyles();

    const [open, setOpen] = React.useState(true);

    const handleClick = () => {
        setOpen(!open);
    };

    return (
        <>
            <TopNav />
            <Table className="mt-4" striped bordered hover size="sm">
                <thead>
                <tr>
                    <th>ID</th>
                    <th>Name</th>
                    <th>Status</th>
                    <th>Modified User</th>
                    <th>Modified Date</th>
                    <th>Version</th>
                    <th>Option</th>
                </tr>
                </thead>
                <tbody>
                {/*{cate.map(category =>*/}
                    <tr key={category.id}>
                        <td>{category.id}</td>
                        <td>{category.name}</td>
                        <td>{category.status}</td>
                        <td>{category.modifiedUser}</td>
                        <td>{category.modifiedDate}</td>
                        <td>{category.version}</td>
                        <td>
                            <ButtonToolbar>
                                <Button className="mr-2" variant="info"
                                        onClick={()=> this.setState({editModalShow:true, id:category.id, name:category.name, status:category.status, version:category.version})}>
                                    Edit
                                </Button>
                                <Button className="mr-2" variant="danger"
                                        onClick={()=> this.deleteCat(category.id)}>
                                    Delete
                                </Button>
                            </ButtonToolbar>
                        </td>
                    </tr>
                {/*)}*/}
                </tbody>
            </Table>
        </>
    );
}
